vote=pd.read_csv('/content/Votes 2019.csv')

vote.head()

vote.describe()

import matplotlib.pyplot as plt
import pandas as pd


# Selecting only necessary columns
hp_subset = vote[["State Name", "EVM Vote", "Total Actual Votes", "Postal Vote"]]

# Plotting the distribution of vote types in different states
plt.figure(figsize=(20, 10))

# Plotting EVM Vote
plt.plot(hp_subset["State Name"], hp_subset["EVM Vote"], label="EVM Vote")

# Plotting Total Actual Votes
plt.plot(hp_subset["State Name"], hp_subset["Total Actual Votes"], label="Total Actual Votes")

# Plotting Postal Vote
plt.plot(hp_subset["State Name"], hp_subset["Postal Vote"], label="Postal Vote")

# Adding labels and title
plt.xlabel("State")
plt.ylabel("Number of Votes")
plt.title("Distribution of Vote Type in Different States")
plt.xticks(rotation=90)
plt.legend()

# Display the plot
plt.show()